window.bookSummaryJSON = "From the opening chapter of the electrifying <i>Dark Harbor</i>, one thing is clear; this is the clarion call of an exciting new talent. Highly touted debut author David Hosp crafts an engrossing novel in the tradition of John Grisham, John Sandford, and David Baldacci. <p> Scott Finn survived a childhood running errands for crime kingpins to become a six-figure lawyer at a prestigious Boston firm. Now the sky's the limit...until his colleague and former lover Natalie turns up dead in Boston Harbor, her heart surgically removed. She initially appears to be the seventh victim of \"Little Jack\", a serial killer reminiscent of Jack the Ripper. But suspicion quickly turns to Scott, who must dig deep into Natalie's life to discover the secrets she kept.</p> <p> The suspense builds to a crescendo as this stunning thriller travels at breakneck speed toward a shocking conclusion.</p>"; 
